import{_ as e,v as l,b as s,R as a}from"./chunks/framework.5ffcbaff.js";import{_ as d}from"./chunks/menu_event.0bf2deec.js";const g="/docs/cocos/assets/animation-panel.c41792fb.png",n="data:image/png;base64,",i="data:image/png;base64,",r="data:image/png;base64,",o="data:image/png;base64,",b="data:image/png;base64,",c="data:image/png;base64,",m="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABUAAAAVCAIAAAAmdTLBAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAAEXRFWHRTb2Z0d2FyZQBTbmlwYXN0ZV0Xzt0AAABeSURBVDiNY3R3d2egADBRonkY6GdB4XEYBCS4aPCxYFX659ONPQs2XPiBR7+qhooIB3bdDAwsIioaqgwXLqMIDrT/R/UPrH7UxHL7xp03MrjT350bt9EFGUfzP0UAAOSlFOTTMdPDAAAAAElFTkSuQmCC",t="data:image/png;base64,",p="data:image/png;base64,",f="data:image/png;base64,",x="data:image/png;base64,",y="data:image/png;base64,",A="data:image/png;base64,",C="data:image/png;base64,",h="/docs/cocos/assets/2-node-list.df3f2ac0.png",k="data:image/png;base64,",B="/docs/cocos/assets/node-operation.b36d8333.png",R="/docs/cocos/assets/animation-timeline.a165e976.png",E="/docs/cocos/assets/above-timeline.efff1e0d.png",X="/docs/cocos/assets/move-line.e836ce96.gif",I="/docs/cocos/assets/time.ddf8cd2f.png",w="/docs/cocos/assets/frame.e9e25f16.png",V="/docs/cocos/assets/times.6dac0d6c.png",D="/docs/cocos/assets/scale.497a6603.gif",U="/docs/cocos/assets/scale-canvas.5e8fd2e7.gif",S="/docs/cocos/assets/4-pro-list.fb24a296.png",Y="data:image/png;base64,",G="/docs/cocos/assets/pro-operation.ed7b77ec.png",u="/docs/cocos/assets/animation-property-track.0952d1d5.png",v="/docs/cocos/assets/key-info.0aff5856.png",F="/docs/cocos/assets/layout.0125ea04.gif",P="/docs/cocos/assets/shortcuts-manager.f23a39d9.png",O="/docs/cocos/assets/shortcuts-change.747b6143.png",j=JSON.parse('{"title":"熟悉动画编辑器","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/animation/animation-editor.md","filePath":"zh/manual/animation/animation-editor.md"}'),z={name:"zh/manual/animation/animation-editor.md"},M=a('<h1 id="熟悉动画编辑器" tabindex="-1">熟悉动画编辑器 <a class="header-anchor" href="#熟悉动画编辑器" aria-label="Permalink to &quot;熟悉动画编辑器&quot;">​</a></h1><p><strong>动画编辑器</strong> 面板用于编辑和预览当前所选节点的动画剪辑。编辑动画数据或者相关属性时，鼠标焦点离开后会立即生效。</p><p>Cocos Creator 的默认布局中已经包含了 <strong>动画编辑器</strong>，也可以通过点击编辑器上方主菜单的 <strong>面板 -&gt; 动画 -&gt; 动画编辑器</strong> 打开 <strong>动画编辑器</strong>。</p><h2 id="面板介绍" tabindex="-1">面板介绍 <a class="header-anchor" href="#面板介绍" aria-label="Permalink to &quot;面板介绍&quot;">​</a></h2><p><strong>动画编辑器</strong> 面板可以划分为以下几个主要部分：</p><p><img src="'+g+'" alt="animation-editor"></p><ol><li><strong>菜单工具栏</strong>：放置一些常用的功能按钮，例如播放/暂停/停止动画、添加事件帧、保存动画、退出编辑等。</li><li><strong>节点列表</strong>：用于显示/设置当前选中节点及其子节点。</li><li><strong>动画时间轴与关键帧预览</strong>：用于显示/设置当前节点（及其子节点）添加的事件帧以及所添加的动画属性上所有关键帧的预览。</li><li><strong>动画属性列表</strong>：用于显示/设置当前选中的节点在当前编辑的动画剪辑中包含的所有动画属性。</li><li><strong>动画属性关键帧预览</strong>：用于显示/设置当前选中节点的各个动画属性上的所有关键帧，当切换到曲线视图时，将显示关键帧连接的曲线轨迹。</li><li><strong>设置当前动画剪辑的相关属性</strong>：用于设置当前动画剪辑的播放模式、播放速度等。</li></ol><p>更多具体内容请参考下文介绍。</p><h3 id="_1-菜单工具栏" tabindex="-1">1. 菜单工具栏 <a class="header-anchor" href="#_1-菜单工具栏" aria-label="Permalink to &quot;1. 菜单工具栏&quot;">​</a></h3><p><strong>菜单工具栏</strong> 中的功能按钮从左到右依次为：</p><table><thead><tr><th style="text-align:left;">图标</th><th style="text-align:left;">功能说明</th><th style="text-align:left;">快捷键</th></tr></thead><tbody><tr><td style="text-align:left;"><img src="'+n+'" alt="menu clips"></td><td style="text-align:left;">切换动画剪辑。当动画组件上挂载了多个动画剪辑时，可通过该按钮切换进行编辑。</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+i+'" alt="jump to first frame"></td><td style="text-align:left;">将红色的时间控制线移动到当前动画剪辑的开头</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>←</kbd></td></tr><tr><td style="text-align:left;"><img src="'+r+'" alt="jump to previous frame"></td><td style="text-align:left;">将时间控制线移动到上一帧</td><td style="text-align:left;"><kbd>←</kbd></td></tr><tr><td style="text-align:left;"><img src="'+o+'" alt="play/pause"></td><td style="text-align:left;">播放/暂停当前动画</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>P</kbd></td></tr><tr><td style="text-align:left;"><img src="'+b+'" alt="jump to next frame"></td><td style="text-align:left;">将时间控制线移动到下一帧</td><td style="text-align:left;"><kbd>→</kbd></td></tr><tr><td style="text-align:left;"><img src="'+c+'" alt="jump to last frame"></td><td style="text-align:left;">将时间控制线移动到当前动画剪辑的结尾</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>→</kbd></td></tr><tr><td style="text-align:left;"><img src="'+m+'" alt="stop"></td><td style="text-align:left;">点击停止当前动画，停止后时间控制线将会移动到第一帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td></tr><tr><td style="text-align:left;"><img src="'+t+'" alt="time"></td><td style="text-align:left;">时间轴的刻度单位显示方式，包括三种：<br><strong>时间：0-00</strong><br><strong>帧：0</strong><br><strong>时间（s）：0 s</strong><br>详情可参考下文 <strong>时间轴的刻度单位显示</strong> 部分的内容。</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+p+'" alt="spacing"></td><td style="text-align:left;">用于设置同时生成多个关键帧时，关键帧之间的间隔大小。</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+f+'" alt="spacing"></td><td style="text-align:left;">间隔排列同时选中的多个关键帧。选中的关键帧将会以第一个帧为基准，以 <strong>Spacing</strong> 输入框中的数值作为间隔大小依次排列</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+d+'" alt="add event"></td><td style="text-align:left;">添加事件帧，点击该按钮即可在当前时间线上方的位置添加事件帧</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+x+'" alt="menu save"></td><td style="text-align:left;">保存当前编辑的动画数据。</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+y+'" alt="menu doc"></td><td style="text-align:left;">点击该按钮即可跳转到官方手册文档关于动画编辑器部分的内容</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td></tr><tr><td style="text-align:left;"><img src="'+A+'" alt="shortcuts"></td><td style="text-align:left;">打开快捷键面板，支持自定义快捷键。详情可参考下文 <strong>快捷键</strong> 部分的内容</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+C+'" alt="exit"></td><td style="text-align:left;">退出动画编辑模式</td><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Q</kbd></td></tr></tbody></table><h3 id="_2-节点列表" tabindex="-1">2. 节点列表 <a class="header-anchor" href="#_2-节点列表" aria-label="Permalink to &quot;2. 节点列表&quot;">​</a></h3><p><img src="'+h+'" alt="node list"></p><p>该区域会显示当前选中的动画节点及其子节点，并以与 <strong>层级管理器</strong> 中的节点树一一对应的方式排列。可点击上方的 <img src="'+k+'" alt="hide"> 按钮来隐藏/显示无动画数据的节点，或者直接在输入框中输入节点名称来快速查找节点。</p><p>目前支持右键点击节点来选择清空节点数据、迁移节点数据、复制粘贴节点数据。具体内容请参考 <a href="./edit-animation-clip.html#节点数据常见操作">节点数据常见操作</a>。</p><p><img src="'+B+'" alt="node operation"></p><h3 id="_3-动画时间轴与关键帧预览" tabindex="-1">3. 动画时间轴与关键帧预览 <a class="header-anchor" href="#_3-动画时间轴与关键帧预览" aria-label="Permalink to &quot;3. 动画时间轴与关键帧预览&quot;">​</a></h3><p><img src="'+R+'" alt="animation timeline"></p><p>动画时间轴主要用于显示/设置当前节点添加的自定义 <a href="./animation-event.html">事件帧</a>、节点（及其子节点）添加的所有动画属性上的 <a href="./edit-animation-clip.html">关键帧</a>（蓝色菱形）并显示预览。</p><p>时间控制线（红色竖线）表示当前动画所处的时间节点，可通过以下几种方式更改当前选中时间：</p><ul><li><p>直接拖拽时间控制线</p></li><li><p>双击关键帧</p></li><li><p>在菜单工具栏中使用相关移动控制按钮</p></li><li><p>使用快捷键，具体控制键可查询下文 <strong>快捷键</strong> 部分的内容</p></li><li><p>在动画时间轴上方区域内点击任意位置</p><p><img src="'+E+'" alt="about the timeline"></p></li></ul><p>移动时间控制线则 <strong>场景编辑器</strong> 中的节点也会根据动画轨迹进行相应的移动。</p><p><img src="'+X+'" alt="move line"></p><h4 id="时间轴的刻度单位显示" tabindex="-1">时间轴的刻度单位显示 <a class="header-anchor" href="#时间轴的刻度单位显示" aria-label="Permalink to &quot;时间轴的刻度单位显示&quot;">​</a></h4><p><strong>菜单工具栏</strong> 中的 <img src="'+t+'" alt="time"> 按钮可用于切换动画时间轴的刻度显示方式。输入框中的数值会随着时间控制线的移动而变化，支持手动输入，输入完成后时间控制线会自动定位到相应的位置。</p><p>目前支持以下三种显示方式：</p><ul><li><p><strong>时间：0-00</strong>（默认）：以秒和帧组合为单位的方式来显示动画时间轴的刻度。输入框前面的数值表示 <strong>秒</strong>，后面的数值表示 <strong>帧</strong>，例如 <code>01-05</code> 表示 1 秒又 5 帧。</p><p><img src="'+I+'" alt="time"></p></li><li><p><strong>帧：0</strong>：以帧为单位的方式来显示动画时间轴的刻度。</p><p><img src="'+w+'" alt="frame"></p></li><li><p><strong>时间（s）：0 s</strong>：以秒为单位的方式来显示动画时间轴的刻度。</p><p><img src="'+V+'" alt="times"></p></li></ul><p>我们一般用帧率（Sample）来表示一秒要划分为多少帧，可以在 <strong>动画编辑器</strong> 底部的 <strong>Sample</strong> 选项中进行调整。当时间轴的刻度单位显示方式不同时，受影响程度也不同。</p><p>当刻度单位设置为 <strong>帧</strong> 时，以帧数为单位，不受帧率影响。<br> 当设置为 <strong>时间</strong> 或者 <strong>时间（s）</strong> 时，同一个刻度表示的时间点会随着帧率的变化而有所不同，这两者之间的转换计算方式如下：</p><table><thead><tr><th style="text-align:left;">帧率（Sample）</th><th style="text-align:left;">时间：00-00</th><th style="text-align:left;">时间（s）：0 s</th></tr></thead><tbody><tr><td style="text-align:left;">30</td><td style="text-align:left;">01-05</td><td style="text-align:left;">1 + 5/30 = 1.17 s</td></tr><tr><td style="text-align:left;">10</td><td style="text-align:left;">01-05</td><td style="text-align:left;">1 + 5/10 = 1.5 s</td></tr></tbody></table><p>例如将帧率设置为 30，在 <code>01-05</code> 刻度上添加了一个关键帧，则该关键帧位于动画开始后的第 35 帧。然后把帧率修改为 10，该关键帧所在的总帧数并没有发生变化，仍然处在动画开始后的第 35 帧，而此时关键帧所在位置的刻度读数变成了 <code>03-05</code>，换算成时间（s）以后正好是之前的 3 倍。</p><h4 id="更改动画时间轴缩放比例" tabindex="-1">更改动画时间轴缩放比例 <a class="header-anchor" href="#更改动画时间轴缩放比例" aria-label="Permalink to &quot;更改动画时间轴缩放比例&quot;">​</a></h4><p>在操作中如果觉得 <strong>动画编辑器</strong> 显示的范围太小，需要按比例缩小，让更多的关键帧显示到编辑器内怎么办？</p><p>在 <strong>动画时间轴</strong> 和 <strong>动画属性关键帧预览</strong> 任一区域内滚动鼠标滚轮，即可放大或者缩小时间轴的横向显示比例。</p><p><img src="'+D+'" alt="scale"></p><h4 id="移动动画时间轴显示区域" tabindex="-1">移动动画时间轴显示区域 <a class="header-anchor" href="#移动动画时间轴显示区域" aria-label="Permalink to &quot;移动动画时间轴显示区域&quot;">​</a></h4><p>在 <strong>动画时间轴</strong> 或者 <strong>动画属性关键帧预览</strong> 任一区域按下鼠标中键/右键进行拖拽，即可查看动画时间轴左/右侧超出显示区域而被隐藏的关键帧。</p><p><img src="'+U+'" alt="scale canvas"></p><h3 id="_4-动画属性列表" tabindex="-1">4. 动画属性列表 <a class="header-anchor" href="#_4-动画属性列表" aria-label="Permalink to &quot;4. 动画属性列表&quot;">​</a></h3><p><img src="'+S+'" alt="node list"></p><p>该区域主要用于显示/添加/设置当前选中的节点在当前动画剪辑中的动画属性。点击右上角的 <strong>+</strong> 按钮即可添加动画属性，动画属性包括了节点自有的属性、组件属性（包含用户自定义脚本组件中的属性）。组件包含的属性前会加上组件的名字，比如 <code>cc.Sprite.spriteFrame</code>。</p><p>右键点击动画属性或者单击动画属性右侧的 <img src="'+Y+'" alt="property"> 按钮即可选择 <strong>移除当前属性轨道</strong>、<strong>清空关键帧</strong>，或者 <strong>复制粘贴当前属性轨道</strong>。具体内容请参考 <a href="./edit-animation-clip.html#动画属性数据常见操作">动画属性数据常见操作</a>。</p><p><img src="'+G+'" alt="property operation"></p><h3 id="_5-动画属性关键帧预览" tabindex="-1">5. 动画属性关键帧预览 <a class="header-anchor" href="#_5-动画属性关键帧预览" aria-label="Permalink to &quot;5. 动画属性关键帧预览&quot;">​</a></h3><p><img src="'+u+'" alt="animation property track"></p><p>该区域主要用于显示当前选中节点在各动画属性上具体的关键帧设置情况，也是关键帧编辑的主要区域。可以直接在右侧的动画属性上点击右键来添加关键帧。同时在该区域也支持框选、点选关键帧来进行移动、复制、粘贴等操作。详情请参考 <a href="./edit-animation-clip.html#关键帧常见操作">关键帧常见操作</a>。</p><p>单击选中某一关键帧，关键帧会由蓝色变成白色并且该区域上方会显示当前关键帧的相关信息，若双击关键帧还会将时间控制线移动到当前关键帧所在位置。</p><p><img src="'+v+'" alt="key info"></p><h3 id="_6-设置当前动画剪辑的相关属性" tabindex="-1">6. 设置当前动画剪辑的相关属性 <a class="header-anchor" href="#_6-设置当前动画剪辑的相关属性" aria-label="Permalink to &quot;6. 设置当前动画剪辑的相关属性&quot;">​</a></h3><p>当前动画剪辑在动画编辑器上可直接设置的属性包括：<strong>WrapMode</strong>、<strong>Sample</strong>、<strong>Speed</strong> 和 <strong>Duration</strong>。具体内容请参考 <a href="./edit-animation-clip.html#动画剪辑属性设置">动画剪辑属性设置</a>。</p><h2 id="调整动画编辑器布局" tabindex="-1">调整动画编辑器布局 <a class="header-anchor" href="#调整动画编辑器布局" aria-label="Permalink to &quot;调整动画编辑器布局&quot;">​</a></h2><p>节点列表与时间轴之间的分界线，以及属性列表与时间轴之间的分界线都是可以用于拖拽更改布局的，通过拖拽可以自由地将 <strong>动画编辑器</strong> 调整成适合编辑的布局效果。</p><p><img src="'+F+'" alt="layout"></p><h2 id="快捷键" tabindex="-1">快捷键 <a class="header-anchor" href="#快捷键" aria-label="Permalink to &quot;快捷键&quot;">​</a></h2><p>点击菜单工具栏的 <img src="'+A+'" alt="shortcuts"> 按钮，即可打开快捷键面板：</p><p><img src="'+P+'" alt="shortcuts manager"></p><p>支持开发者自定义 <strong>动画编辑器</strong> 的快捷键，直接点击要修改的功能的快捷键组合，会出现如下图所示的提示，即可直接修改快捷键。</p><p><img src="'+O+'" alt="shortcuts change"></p><h3 id="默认快捷键汇总" tabindex="-1">默认快捷键汇总 <a class="header-anchor" href="#默认快捷键汇总" aria-label="Permalink to &quot;默认快捷键汇总&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">功能</th><th style="text-align:left;">快捷键</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">进入/退出动画编辑器</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>E</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">保存动画数据</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">向前移动一帧</td><td style="text-align:left;"><kbd>←</kbd></td><td style="text-align:left;">如果已经在第 0 帧，则忽略当前操作。未选中关键帧时移动的是时间控制线，选中关键帧时移动的是关键帧</td></tr><tr><td style="text-align:left;">向后移动一帧</td><td style="text-align:left;"><kbd>→</kbd></td><td style="text-align:left;">未选中关键帧时移动的是时间控制线，选中关键帧后移动的是关键帧</td></tr><tr><td style="text-align:left;">移动到第一帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>←</kbd></td><td style="text-align:left;">将红色的时间控制线移动到当前动画剪辑的开头</td></tr><tr><td style="text-align:left;">移动到最后一帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>→</kbd></td><td style="text-align:left;">将时间控制线移动到当前动画剪辑的结尾</td></tr><tr><td style="text-align:left;">删除当前选中关键帧</td><td style="text-align:left;"><kbd>Delete</kbd> / <kbd>Cmd</kbd> + <kbd>Backspace</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">播放/暂停动画</td><td style="text-align:left;"><kbd>P</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">停止动画</td><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>S</kbd></td><td style="text-align:left;">当前时间将变为 0，且时间控制线将会移动到第一帧</td></tr><tr><td style="text-align:left;">添加关键帧</td><td style="text-align:left;"><kbd>K</kbd></td><td style="text-align:left;">选中任一动画属性后，将会在时间控制线所在位置添加关键帧，没有选中动画属性则忽略</td></tr><tr><td style="text-align:left;">跳到上一个关键帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>←</kbd></td><td style="text-align:left;">将时间控制线移动到左侧最近的一个关键帧（在选中的属性轨道上或选中的节点上）</td></tr><tr><td style="text-align:left;">跳到下一个关键帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>→</kbd></td><td style="text-align:left;">将时间控制线移动到右侧最近的一个关键帧（选中的属性轨道上或选中的节点上）</td></tr><tr><td style="text-align:left;">多选关键帧</td><td style="text-align:left;"><kbd>Ctrl</kbd></td><td style="text-align:left;">按住 <kbd>Ctrl</kbd> 点击关键帧可多选关键帧。再次按下 <kbd>Ctrl</kbd> 后也可以继续选取关键帧进行补充</td></tr><tr><td style="text-align:left;">全选动画属性关键帧</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>A</kbd></td><td style="text-align:left;">全选选中的动画属性上的所有关键帧</td></tr><tr><td style="text-align:left;">复制选中的动画数据</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>C</kbd></td><td style="text-align:left;">支持复制选中的关键帧、属性轨道、节点数据，同时只能复制一种数据，且按照这个顺序来决定复制优先级</td></tr><tr><td style="text-align:left;">粘贴上一次复制的动画数据</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>V</kbd></td><td style="text-align:left;">支持跨编辑器（限 v3.x）粘贴上一次复制的动画数据（例如动画关键帧数、动画属性、动画节点数据，并按照该排序依次检查当前可粘贴的数据）。</td></tr><tr><td style="text-align:left;">取消选中的关键帧/事件帧/属性轨道</td><td style="text-align:left;"><kbd>Esc</kbd></td><td style="text-align:left;">-</td></tr></tbody></table><blockquote><p><strong>注意</strong>：目前除了 <strong>进入/退出动画编辑器</strong>、<strong>保存动画</strong> 的快捷键是全局可用以外，其他快捷键都需要鼠标焦点在动画编辑器面板时才生效。</p></blockquote>',61),T=[M];function Z(N,H,K,W,Q,q){return l(),s("div",null,T)}const _=e(z,[["render",Z]]);export{j as __pageData,_ as default};
